next.addEventListener('click', function () {
  alert('sizda boshqa video yo`q');
});
prevSpeed.addEventListener('click', function () {
  return playDownSpeed();
});
nextSpeed.addEventListener('click', function () {
  return playUpSpeed();
});

function playDownSpeed() {
  if (video.playbackRate > 0) {
    video.playbackRate -= 0.25;
    textSpeed.style.opacity = '1';
    textSpeed.innerHTML = video.playbackRate + 'x';
    setTimeout(function () {
      textSpeed.style.opacity = '0';
    }, 1000);
  }
}

function playUpSpeed() {
  if (video.playbackRate < 2) {
    video.playbackRate += 0.25;
    textSpeed.style.opacity = '1';
    textSpeed.innerHTML = video.playbackRate + 'x';
    setTimeout(function () {
      textSpeed.style.opacity = '0';
    }, 1000);
  }
}

volumeIcon.addEventListener('click', function () {
  return video.muted == true ? video.muted = false : video.muted = true;
});
var volumeIcons = ['mute', 'off', 'down', 'downup', 'up'];

video.onvolumechange = function () {
  for (var i = 0; i < volumeIcons.length; i++) {
    volumeIcon.classList.remove(volumeIcons[i]);
  }

  var volume = video.volume * 100;

  if (video.muted) {
    volumeIcon.classList.add('mute');
  } else if (volume > 75) {
    volumeIcon.classList.add('up');
  } else if (volume > 50) {
    volumeIcon.classList.add('downup');
  } else if (volume > 25) {
    volumeIcon.classList.add('down');
  } else if (volume > 0) {
    volumeIcon.classList.add('off');
  } else if (volume == 0) {
    volumeIcon.classList.add('mute');
  }
};

range.addEventListener('change', function (e) {
  video.volume = e.currentTarget.value / 100;
});
line.addEventListener('click', function (e) {
  var videoTime = e.offsetX / line.clientWidth * video.duration;
  video.currentTime = videoTime;
});
video.addEventListener('timeupdate', function () {
  var progressTime = video.currentTime / video.duration;
  progress.style.width = progressTime * 100 + '%';
});
restart.addEventListener('click', function () {
  video.currentTime = 0;
});
screen.addEventListener('click', function () {
  video.requestFullscreen();
});
